import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Note from "../components/Note";

function dynamicNote(note){
return(
<Note 
    title={note.title}
    content={note.content}
/>
);

}



function App(){
    return (
    <div>
    <Header />

    {note.map(dynamicNote)}

    <Footer />
     </div>);
};






export default App;
